import React from 'react';
import styled from '@emotion/styled';

const StickPage = styled.div`
display: flex;
flex-direction: column;
width:100%;
height:92.7vh;
background-color:yellow;
`;
const StickTitle = styled.div`
height:10%;
font-size: 50px;
text-align: center;
`

const SticksContainer = () => {
    return (  
        <StickPage>
            <StickTitle>Stick</StickTitle>
            <div style={{display:"flex",flexDirection:"row", backgroundColor:"cyan"}}>
                <div>Stick 1</div>
                <div>Stick 1</div>
                <div>Stick 1</div>
                <div>Stick 1</div>
                <div>Stick 1</div>
            </div>
        </StickPage>
    );
}
 
export default SticksContainer
